import{_ as a,c as e,o as r,b as h}from"./app.537fd2fd.js";const p=JSON.parse('{"title":"\uCC9C \uB9AC \uAE38\uB3C4 \uCCAB \uAC78\uC74C\uC73C\uB85C \uC2DC\uC791\uB41C\uB2E4.","description":"","frontmatter":{"title":"\uCC9C \uB9AC \uAE38\uB3C4 \uCCAB \uAC78\uC74C\uC73C\uB85C \uC2DC\uC791\uB41C\uB2E4.","createBy":"2022-09-05T00:00:00.000Z"},"headers":[{"level":2,"title":"\uB0B4 \uC55E\uBA38\uB9AC","slug":"\uB0B4-\uC55E\uBA38\uB9AC"}],"relativePath":"TIL/202209/20220905.md"}'),i={name:"TIL/202209/20220905.md"},t=h('<br><h2 style="font-size:26px;color:#ffe4e1;">\uC624\uB298\uC758 \uC774\uC57C\uAE30\u{1F9E7}</h2><hr><h4 id="\uC624\uB298\uC740-\uC5EC\uB984\uBC29\uD559-\uC26C\uACE0-\uC0AC\uC2E4-\uC5EC\uB984\uBC29\uD559-\uB0B4\uB0B4-\uD559\uAD50\uB098-\uAC10-\uD68C\uC0AC\uB97C-\uB2E4\uC2DC-\uB098\uAC00\uB294-\uB0A0\uC774\uB2E4-\uC624\uB79C\uB9CC\uC5D0-\uAC08-\uC0DD\uAC01\uC744-\uD558\uB2C8-\uBB54\uC9C0-\uBAA8\uB97C-\uAC71\uC815-\uB54C\uBB38\uC5D0-\uC7A0\uC774-\uC548-\uC654\uB2E4-\uB2E4\uC2DC-\uD68C\uC0AC\uB97C-\uAC08-\uAC71\uC815-\uB54C\uBB38\uC77C\uAE4C-\uC544\uB2C8\uBA74-\uC5B4\uC81C-2\uC2DC\uAC04-\uC794-\uB0AE\uC7A0-\uB54C\uBB38\uC77C\uAE4C-\uADF8-\uC758\uBB38\uC740-\uD68C\uC0AC\uC5D0-\uB4E4\uC5B4\uAC00\uACE0-\uB531-\uD480\uB838\uB2E4-\uC624\uB79C\uB9CC\uC5D0-\uBCF4\uB294-\uD68C\uC0AC-\uBD84\uB4E4\uC774-\uB108\uBB34-\uBC18\uAC00\uC6E0\uB2E4-\uB2E4\uD589\uD788-\uD6C4\uC790\uC600\uB2E4-\uD68C\uC0AC-\uAC00\uC11C-\uC138\uD305-\uC870\uAE08\uD558\uACE0-\uC54C\uACE0\uB9AC\uC998\uC744-\uB0B4\uC8FC\uC2E0-\uAC70-\uD478\uB2C8\uAE4C-\uC2DC\uAC04\uC774-\uB418\uAC8C-\uC77C\uCC0D-\uAC14\uB2E4" tabindex="-1">\uC624\uB298\uC740 \uC5EC\uB984\uBC29\uD559 \uC26C\uACE0(\uC0AC\uC2E4 \uC5EC\uB984\uBC29\uD559 \uB0B4\uB0B4 \uD559\uAD50\uB098 \uAC10) \uD68C\uC0AC\uB97C \uB2E4\uC2DC \uB098\uAC00\uB294 \uB0A0\uC774\uB2E4. \uC624\uB79C\uB9CC\uC5D0 \uAC08 \uC0DD\uAC01\uC744 \uD558\uB2C8 \uBB54\uC9C0 \uBAA8\uB97C \uAC71\uC815 \uB54C\uBB38\uC5D0 \uC7A0\uC774 \uC548 \uC654\uB2E4. \uB2E4\uC2DC \uD68C\uC0AC\uB97C \uAC08 \uAC71\uC815 \uB54C\uBB38\uC77C\uAE4C \uC544\uB2C8\uBA74 \uC5B4\uC81C 2\uC2DC\uAC04 \uC794 \uB0AE\uC7A0 \uB54C\uBB38\uC77C\uAE4C \uADF8 \uC758\uBB38\uC740 \uD68C\uC0AC\uC5D0 \uB4E4\uC5B4\uAC00\uACE0 \uB531 \uD480\uB838\uB2E4. \uC624\uB79C\uB9CC\uC5D0 \uBCF4\uB294 \uD68C\uC0AC \uBD84\uB4E4\uC774 \uB108\uBB34 \uBC18\uAC00\uC6E0\uB2E4. (\uB2E4\uD589\uD788 \uD6C4\uC790\uC600\uB2E4.) \uD68C\uC0AC \uAC00\uC11C \uC138\uD305 \uC870\uAE08\uD558\uACE0 \uC54C\uACE0\uB9AC\uC998\uC744 \uB0B4\uC8FC\uC2E0 \uAC70 \uD478\uB2C8\uAE4C \uC2DC\uAC04\uC774 \uB418\uAC8C \uC77C\uCC0D \uAC14\uB2E4. <a class="header-anchor" href="#\uC624\uB298\uC740-\uC5EC\uB984\uBC29\uD559-\uC26C\uACE0-\uC0AC\uC2E4-\uC5EC\uB984\uBC29\uD559-\uB0B4\uB0B4-\uD559\uAD50\uB098-\uAC10-\uD68C\uC0AC\uB97C-\uB2E4\uC2DC-\uB098\uAC00\uB294-\uB0A0\uC774\uB2E4-\uC624\uB79C\uB9CC\uC5D0-\uAC08-\uC0DD\uAC01\uC744-\uD558\uB2C8-\uBB54\uC9C0-\uBAA8\uB97C-\uAC71\uC815-\uB54C\uBB38\uC5D0-\uC7A0\uC774-\uC548-\uC654\uB2E4-\uB2E4\uC2DC-\uD68C\uC0AC\uB97C-\uAC08-\uAC71\uC815-\uB54C\uBB38\uC77C\uAE4C-\uC544\uB2C8\uBA74-\uC5B4\uC81C-2\uC2DC\uAC04-\uC794-\uB0AE\uC7A0-\uB54C\uBB38\uC77C\uAE4C-\uADF8-\uC758\uBB38\uC740-\uD68C\uC0AC\uC5D0-\uB4E4\uC5B4\uAC00\uACE0-\uB531-\uD480\uB838\uB2E4-\uC624\uB79C\uB9CC\uC5D0-\uBCF4\uB294-\uD68C\uC0AC-\uBD84\uB4E4\uC774-\uB108\uBB34-\uBC18\uAC00\uC6E0\uB2E4-\uB2E4\uD589\uD788-\uD6C4\uC790\uC600\uB2E4-\uD68C\uC0AC-\uAC00\uC11C-\uC138\uD305-\uC870\uAE08\uD558\uACE0-\uC54C\uACE0\uB9AC\uC998\uC744-\uB0B4\uC8FC\uC2E0-\uAC70-\uD478\uB2C8\uAE4C-\uC2DC\uAC04\uC774-\uB418\uAC8C-\uC77C\uCC0D-\uAC14\uB2E4" aria-hidden="true">#</a></h4><br><h4 id="\uC544-\uADF8\uB9AC\uACE0-\uC54C\uACE0\uB9AC\uC998-\uD480\uBA74\uC11C-\uB290\uB080-\uAC74\uB370-\uC9C4\uC9DC-\uAE30\uB2A5\uB9CC-\uB418\uBA74-\uB418\uC9C0-\uC0DD\uAC01\uB9CC-\uD588\uB294\uB370-\uB2E4-\uD480\uACE0-\uD655\uC778\uD574-\uBCF4\uB2C8\uAE4C-\uC131\uB2A5-\uB54C\uBB38\uC5D0-\uC2E4\uD328\uD588\uB2E4\uB294-\uAC83\uC774\uB2E4-\uAE30\uB2A5\uB300\uD68C-\uB355\uBD84\uC5D0-\uAE4C\uBA39\uC740-\uB108\uBB34-\uB2F9\uC5F0\uD55C-\uAC78-\uAE30\uC5B5\uC744-\uC0C1\uAE30\uC2DC\uCF1C\uC92C\uB2E4" tabindex="-1">\uC544 \uADF8\uB9AC\uACE0 \uC54C\uACE0\uB9AC\uC998 \uD480\uBA74\uC11C \uB290\uB080 \uAC74\uB370 \uC9C4\uC9DC \uAE30\uB2A5\uB9CC \uB418\uBA74 \uB418\uC9C0 \uC0DD\uAC01\uB9CC \uD588\uB294\uB370 \uB2E4 \uD480\uACE0 \uD655\uC778\uD574 \uBCF4\uB2C8\uAE4C \uC131\uB2A5 \uB54C\uBB38\uC5D0 \uC2E4\uD328\uD588\uB2E4\uB294 \uAC83\uC774\uB2E4. \uAE30\uB2A5\uB300\uD68C \uB355\uBD84\uC5D0 \uAE4C\uBA39\uC740 \uB108\uBB34 \uB2F9\uC5F0\uD55C \uAC78 \uAE30\uC5B5\uC744 \uC0C1\uAE30\uC2DC\uCF1C\uC92C\uB2E4. <a class="header-anchor" href="#\uC544-\uADF8\uB9AC\uACE0-\uC54C\uACE0\uB9AC\uC998-\uD480\uBA74\uC11C-\uB290\uB080-\uAC74\uB370-\uC9C4\uC9DC-\uAE30\uB2A5\uB9CC-\uB418\uBA74-\uB418\uC9C0-\uC0DD\uAC01\uB9CC-\uD588\uB294\uB370-\uB2E4-\uD480\uACE0-\uD655\uC778\uD574-\uBCF4\uB2C8\uAE4C-\uC131\uB2A5-\uB54C\uBB38\uC5D0-\uC2E4\uD328\uD588\uB2E4\uB294-\uAC83\uC774\uB2E4-\uAE30\uB2A5\uB300\uD68C-\uB355\uBD84\uC5D0-\uAE4C\uBA39\uC740-\uB108\uBB34-\uB2F9\uC5F0\uD55C-\uAC78-\uAE30\uC5B5\uC744-\uC0C1\uAE30\uC2DC\uCF1C\uC92C\uB2E4" aria-hidden="true">#</a></h4><br><h4 id="\uADF8\uB807\uAC8C-5\uC2DC-10\uBD84-\uC815\uB3C4\uC5D0-\uD1F4\uADFC\uD558\uACE0-\uB098\uC640\uC11C-\uBC14\uB85C-\uD5EC\uC2A4\uC7A5\uC73C\uB85C-\uD5A5\uD588\uB2E4-\uC900\uC6B0\uB791-\uAC19\uC774-\uC6B4\uB3D9\uC744-\uD558\uB824\uACE0-\uB0B4\uAC00-\uB2E4\uB2C8\uB294-\uD5EC\uC2A4\uC7A5\uC5D0-\uAC00\uC11C-\uB4F1\uB85D\uC744-\uD588\uB2E4-\uD589\uC0AC\uB97C-\uD574\uC11C-\uADF8\uB7F0\uAC00-6\uAC1C\uC6D4\uC774\uB791-1\uB144\uC774\uB791-\uBCC4\uB2E4\uB97C-\uAC8C-\uC5C6\uC5B4\uC11C-1\uB144\uC73C\uB85C-\uB4F1\uB85D\uD588\uB2E4-\uB098\uB294-\uD56D\uC0C1-3\uAC1C\uC6D4-6\uAC1C\uC6D4-\uB2E8\uC704\uB85C-\uB4F1\uB85D\uD588\uC5C8\uB294\uB370-\uB098\uB3C4-\uC9C0\uAE08-\uD589\uC0AC\uD560-\uB54C-\uC7AC\uB4F1\uB85D\uC744-\uD574\uC57C\uACA0\uB2E4" tabindex="-1">\uADF8\uB807\uAC8C 5\uC2DC 10\uBD84 \uC815\uB3C4\uC5D0 \uD1F4\uADFC\uD558\uACE0 \uB098\uC640\uC11C \uBC14\uB85C \uD5EC\uC2A4\uC7A5\uC73C\uB85C \uD5A5\uD588\uB2E4. \uC900\uC6B0\uB791 \uAC19\uC774 \uC6B4\uB3D9\uC744 \uD558\uB824\uACE0 \uB0B4\uAC00 \uB2E4\uB2C8\uB294 \uD5EC\uC2A4\uC7A5\uC5D0 \uAC00\uC11C \uB4F1\uB85D\uC744 \uD588\uB2E4. \uD589\uC0AC\uB97C \uD574\uC11C \uADF8\uB7F0\uAC00 6\uAC1C\uC6D4\uC774\uB791 1\uB144\uC774\uB791 \uBCC4\uB2E4\uB97C \uAC8C \uC5C6\uC5B4\uC11C 1\uB144\uC73C\uB85C \uB4F1\uB85D\uD588\uB2E4. \uB098\uB294 \uD56D\uC0C1 3\uAC1C\uC6D4 6\uAC1C\uC6D4 \uB2E8\uC704\uB85C \uB4F1\uB85D\uD588\uC5C8\uB294\uB370 \uB098\uB3C4 \uC9C0\uAE08 \uD589\uC0AC\uD560 \uB54C \uC7AC\uB4F1\uB85D\uC744 \uD574\uC57C\uACA0\uB2E4. <a class="header-anchor" href="#\uADF8\uB807\uAC8C-5\uC2DC-10\uBD84-\uC815\uB3C4\uC5D0-\uD1F4\uADFC\uD558\uACE0-\uB098\uC640\uC11C-\uBC14\uB85C-\uD5EC\uC2A4\uC7A5\uC73C\uB85C-\uD5A5\uD588\uB2E4-\uC900\uC6B0\uB791-\uAC19\uC774-\uC6B4\uB3D9\uC744-\uD558\uB824\uACE0-\uB0B4\uAC00-\uB2E4\uB2C8\uB294-\uD5EC\uC2A4\uC7A5\uC5D0-\uAC00\uC11C-\uB4F1\uB85D\uC744-\uD588\uB2E4-\uD589\uC0AC\uB97C-\uD574\uC11C-\uADF8\uB7F0\uAC00-6\uAC1C\uC6D4\uC774\uB791-1\uB144\uC774\uB791-\uBCC4\uB2E4\uB97C-\uAC8C-\uC5C6\uC5B4\uC11C-1\uB144\uC73C\uB85C-\uB4F1\uB85D\uD588\uB2E4-\uB098\uB294-\uD56D\uC0C1-3\uAC1C\uC6D4-6\uAC1C\uC6D4-\uB2E8\uC704\uB85C-\uB4F1\uB85D\uD588\uC5C8\uB294\uB370-\uB098\uB3C4-\uC9C0\uAE08-\uD589\uC0AC\uD560-\uB54C-\uC7AC\uB4F1\uB85D\uC744-\uD574\uC57C\uACA0\uB2E4" aria-hidden="true">#</a></h4><br><h4 id="\uB4F1\uB85D\uD558\uACE0-\uC624\uB79C\uB9CC\uC5D0-\uC6B4\uB3D9\uC744-\uD558\uB294\uB370-\uC804\uC5D0-\uD558\uB358-\uAC83\uCC98\uB7FC-\uBB34\uAC8C\uAC00-\uC548-\uB4E4\uC5B4\uC838\uC11C-\uB180\uB790\uB2E4-\uADF8\uB7EC\uB2E4\uAC00-\uC544\uCC28-\uC0DD\uAC01\uC774-\uB4E4\uC5C8\uB2E4-\uC624\uB298-\uC2DD\uC0AC\uB97C-\uC81C\uB300\uB85C-\uC548-\uD588\uAD6C\uB098-\uC810\uC2EC\uB3C4-\uAC70\uC758-\uB2E4-\uB0A8\uAE30\uACE0-\uC544\uCE68\uB3C4-\uC548-\uBA39\uACE0-\uB0B4\uC77C\uBD80\uD130\uB294-\uC798-\uCC59\uACA8-\uBA39\uC5B4\uC57C\uACA0\uB2E4-\uADF8\uB9AC\uACE0-\uC9D1\uC5D0-\uC624\uB2C8\uAE4C-8\uC2DC\uC600\uB2E4-\uC800\uB141\uC774-\uC788\uB294-\uC0B6\uC740-\uB108\uBB34-\uC88B\uB2E4" tabindex="-1">\uB4F1\uB85D\uD558\uACE0 \uC624\uB79C\uB9CC\uC5D0 \uC6B4\uB3D9\uC744 \uD558\uB294\uB370 \uC804\uC5D0 \uD558\uB358 \uAC83\uCC98\uB7FC \uBB34\uAC8C\uAC00 \uC548 \uB4E4\uC5B4\uC838\uC11C \uB180\uB790\uB2E4. \uADF8\uB7EC\uB2E4\uAC00 \uC544\uCC28 \uC0DD\uAC01\uC774 \uB4E4\uC5C8\uB2E4. \uC624\uB298 \uC2DD\uC0AC\uB97C \uC81C\uB300\uB85C \uC548 \uD588\uAD6C\uB098 \uC810\uC2EC\uB3C4 \uAC70\uC758 \uB2E4 \uB0A8\uAE30\uACE0 \uC544\uCE68\uB3C4 \uC548 \uBA39\uACE0 \uB0B4\uC77C\uBD80\uD130\uB294 \uC798 \uCC59\uACA8 \uBA39\uC5B4\uC57C\uACA0\uB2E4. \uADF8\uB9AC\uACE0 \uC9D1\uC5D0 \uC624\uB2C8\uAE4C 8\uC2DC\uC600\uB2E4. \uC800\uB141\uC774 \uC788\uB294 \uC0B6\uC740 \uB108\uBB34 \uC88B\uB2E4 <a class="header-anchor" href="#\uB4F1\uB85D\uD558\uACE0-\uC624\uB79C\uB9CC\uC5D0-\uC6B4\uB3D9\uC744-\uD558\uB294\uB370-\uC804\uC5D0-\uD558\uB358-\uAC83\uCC98\uB7FC-\uBB34\uAC8C\uAC00-\uC548-\uB4E4\uC5B4\uC838\uC11C-\uB180\uB790\uB2E4-\uADF8\uB7EC\uB2E4\uAC00-\uC544\uCC28-\uC0DD\uAC01\uC774-\uB4E4\uC5C8\uB2E4-\uC624\uB298-\uC2DD\uC0AC\uB97C-\uC81C\uB300\uB85C-\uC548-\uD588\uAD6C\uB098-\uC810\uC2EC\uB3C4-\uAC70\uC758-\uB2E4-\uB0A8\uAE30\uACE0-\uC544\uCE68\uB3C4-\uC548-\uBA39\uACE0-\uB0B4\uC77C\uBD80\uD130\uB294-\uC798-\uCC59\uACA8-\uBA39\uC5B4\uC57C\uACA0\uB2E4-\uADF8\uB9AC\uACE0-\uC9D1\uC5D0-\uC624\uB2C8\uAE4C-8\uC2DC\uC600\uB2E4-\uC800\uB141\uC774-\uC788\uB294-\uC0B6\uC740-\uB108\uBB34-\uC88B\uB2E4" aria-hidden="true">#</a></h4><h2 style="font-size:26px;color:#40e0d0;">\uC5B8\uC820\uAC00 \uD560 \uC77C</h2><hr><ul><li><h4 id="\uD5EC\uC2A4\uC7A5-\uC7AC\uB4F1\uB85D\uD558\uAE30" tabindex="-1">\uD5EC\uC2A4\uC7A5 \uC7AC\uB4F1\uB85D\uD558\uAE30 <a class="header-anchor" href="#\uD5EC\uC2A4\uC7A5-\uC7AC\uB4F1\uB85D\uD558\uAE30" aria-hidden="true">#</a></h4></li><li><h4 id="\uBC8C\uD06C\uC5C5-\uC2DD\uB2E8-\uC81C\uB300\uB85C-\uC9C0\uCF1C-\uBA39\uAE30" tabindex="-1">\uBC8C\uD06C\uC5C5 \uC2DD\uB2E8 \uC81C\uB300\uB85C \uC9C0\uCF1C \uBA39\uAE30 <a class="header-anchor" href="#\uBC8C\uD06C\uC5C5-\uC2DD\uB2E8-\uC81C\uB300\uB85C-\uC9C0\uCF1C-\uBA39\uAE30" aria-hidden="true">#</a></h4></li><li><h4 id="\uBE14\uB85C\uADF8-\uAFB8\uBBF8\uAE30" tabindex="-1">\uBE14\uB85C\uADF8 \uAFB8\uBBF8\uAE30 <a class="header-anchor" href="#\uBE14\uB85C\uADF8-\uAFB8\uBBF8\uAE30" aria-hidden="true">#</a></h4></li></ul><h2 style="font-size:26px;color:#dc143c;">\uC624\uB298\uC758 \uACF5\uBD80</h2><hr><h4 id="\uD504\uB85C\uADF8\uB798\uBA38\uC2A4-\uD55C-\uBB38\uC81C" tabindex="-1">\uD504\uB85C\uADF8\uB798\uBA38\uC2A4 \uD55C \uBB38\uC81C <a class="header-anchor" href="#\uD504\uB85C\uADF8\uB798\uBA38\uC2A4-\uD55C-\uBB38\uC81C" aria-hidden="true">#</a></h4><h4 id="\uB9AC\uC561\uD2B8-\uB9DB-\uBCF4\uAE30" tabindex="-1">\uB9AC\uC561\uD2B8 \uB9DB \uBCF4\uAE30 <a class="header-anchor" href="#\uB9AC\uC561\uD2B8-\uB9DB-\uBCF4\uAE30" aria-hidden="true">#</a></h4><h2 id="\uB0B4-\uC55E\uBA38\uB9AC" tabindex="-1">\uB0B4 \uC55E\uBA38\uB9AC <a class="header-anchor" href="#\uB0B4-\uC55E\uBA38\uB9AC" aria-hidden="true">#</a></h2><img src="https://img.insight.co.kr/static/2019/03/25/700/56yotjymwzu81tqi2z7t.jpg">',19),d=[t];function n(s,c,o,l,_,f){return r(),e("div",null,d)}var x=a(i,[["render",n]]);export{p as __pageData,x as default};
